script: |
  super -f text -I q6385.spq | sort > q6385.out

inputs:
  - name: q6385.spq
    data: |
      SELECT ( - - col1 ) FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 BETWEEN + col0 AND ( - - 39 * + - col1 * 23 + col2 + col1 / - + 27 + col0 * - 26 - 7 );
  - name: tab1

outputs:
  - name: q6385.out
    data: |
